import React, {Component} from 'react';
import Navbar from './Navbar';
import './Work.css';
import brankas from '../media/brankas.png';


class Work extends Component {
    render() {
        return (
            <div> 
                <Navbar page="work"/>
                <div className="workPage">
                    <h1 className="workHeader"> WORK
                    </h1>
                    <div className="brankas">
                        <img className="pic" src={brankas}/>             
                    </div>
                </div>    
            </div>
        );
    }
}

export default Work;
